    {'trx_id': 'a79e2485b0eb460e14f55c66c75fd1fefd7048cb',
     'block': 25926363, 'trx_in_block': 34, 'op_in_trx': 0,
     'virtual_op': 0, 'timestamp': '2018-09-13T14:31:39',
     'op': ['comment',
            {'parent_author': '', 'parent_permlink': 'gaming',
             'author': 'retro-room',
             'permlink': 'more-video-game-publishers-are-popping-up-to-give-indie-games-physical-releases',
             'title': 'More video game publishers are popping up to give indie games physical releases',
             'body': "![physical.jpg](https://cdn.steemitimages.com/DQmWZq6qGX8K1j8Jmt5duLxpv5zEg2D8zkXEq381EREiMX8/physical.jpg)\n\nLimited Run Games was established four years ago as a small operation devoted to bringing games that only received a digital release to a physical format.  The company was inspired to go this route when they wanted to see their own game *Breach and Clear* get released on physical media, which eventually grew into a publisher for other indie developers.\n\nOver the past four years, Limited Run Games has grown into a fun publisher to watch.  Not only do they bring small and interesting games to physical media, but they also produce amazing collectors editions with bonuses like posters, CD soundtracks and more.  Their *Night Trap* collector's edition even included a VHS (you read that right) copy of the game's footage edited into a 'film.'\n\nThanks to the success of Limited Run Games, other companies have sprouted to bring even more digital-only games to the game collectors market.  Here's a list of other companies who have gotten into the niche-publishing scene and a list of some of the Nintendo Switch games they're releasing on physical media.\n\n# Super Rare Games\n***\nOn sale now:\n- Mutant Mudds Collection\n- Worms: WMD\n- Snake Pass \n- Human: Fall Flat\n- The Flame in the Flood\n\nComing Soon: \n- Steredenn: Binary Stars\n- N++ Ultimate Edition\n- Adventure Pals\n- Knights of Pen and Paper\n- Fairune Collection\n \n# Fangamer\n***\nComing soon:\n-Undertale\n\n# Signature Edition Games\n***\nOn sale now:\n- Dead Cells\n- The Coma: Recut\n- Slain: Back from Hell\n- Yonder: The Cloud Catcher Chronicles\n- The Count Lucanor\n\nComing soon\n- Candle: The Power of the Flame\n\n# I am 8-bit\n***\nComing soon:\n- Go Home\n\n# Special Reserve Games\n***\nComing soon:\n- Enter The Gungeon\n- The Messenger\n\n# Skybound Games\n***\nComing soon:\n- Hollow Knight (Currently playing this amazing game -- will double-dip for the physical release!)\n\nMany of these releases are offered in special collectors editions with bonus swag for hardcore fans, like soundtracks, art books, posters, pins and more.\n\n<center>\n![Decorative-Line-Black-PNG-Image.png](https://steemitimages.com/DQmSHbisKuhhmHYNa9Wu8Ybb6kDXwLTWjNW1hYwaqNfU4HN/Decorative-Line-Black-PNG-Image.png)\n\n## Thanks for reading.  As always, upvotes, resteems and comments are appreciated! ##\n\n<sub><sup>[Cover Image Source](https://www.tweaktown.com/news/62892/team-cherry-announces-hollow-knight-physical-copy-release/index.html)</sup>\n</center>\n\n",
             'json_metadata': '{"community":"busy","app":"busy/2.5.6","format":"markdown","tags":["gaming","news","steemgc","busy","blog"],"users":[],"links":["https://www.tweaktown.com/news/62892/team-cherry-announces-hollow-knight-physical-copy-release/index.html"],"image":["https://cdn.steemitimages.com/DQmWZq6qGX8K1j8Jmt5duLxpv5zEg2D8zkXEq381EREiMX8/physical.jpg","https://steemitimages.com/DQmSHbisKuhhmHYNa9Wu8Ybb6kDXwLTWjNW1hYwaqNfU4HN/Decorative-Line-Black-PNG-Image.png"]}'}]},
